import { useState, useEffect } from "react";
import "./StarApi.css"
type resultProps = {
    name: string, 
    height: number, 
    mass: string, 
    hair_color:string, 
    skin_color: string, 
    eye_color: string, 
    birth_year: string, 
    gender: string, 
    homeworld: string, 
};

 const StarApi=()=> {
  const [result, setResult] = useState<resultProps[]>([]);

  useEffect(() => {
    const fectchApi = async () => {
      const data = await fetch("https://swapi.dev/api/people/", {
        method: "GET"
      });
      const jsonData = await data.json();
      setResult(jsonData.results);
    };

    fectchApi();
  }, []);

  return (
    <div className="App">

        {result.map((value) => {
          return (
            <div className="container">
                <div className="row">
                <div className="col-lg-3 col-md-3 col-sm-3 col-12 mb-4 position-relative text-dark">
                    <h2 >Name: {value.name}</h2>
                    <h2 >Hair Color: {value.hair_color}</h2>
                    <h2 >Gender: {value.gender}</h2>
    </div>
                </div>


            </div>
          );
        })}


    </div>
  );
}

export default StarApi;
